INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 4, 0.0, 4, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24015, 0.0, "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 4, 4.0, 1, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24016, 0.0, "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 4, 0.0, 4, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24017, 0.0, "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 1, 5.2, 2, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24018, 0.0, "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 5, 4.2, 6, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24019, 0.0, "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 2, 0.0, 2, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24020, 0.0, "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 1, 6.4, 6, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24021, 0.0, "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 2, 0.0, 2, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24022, 0.0, "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 6, 10.08, 3, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24023, 0.0, "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 1, 5.0, 2, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24024, 0.0, "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, 10021, 0.0);
INSERT INTO `v1_7382dcfaca88e9d131c193ea7e513c66ca822b4978b70c86a85b37c6612894a5` VALUES (110501, 2, 0.0, 2, 24, "2019/07/31 12:00:00", "カオリ（サマー）", 24025, 0.0, "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, 10021, 0.0);
